void lloyds_kernel_top::thread_ap_NS_fsm() {
    switch (ap_CS_fsm.read().to_uint()) {
        case 0 : 
            if (!esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_0)) {
                ap_NS_fsm = ap_ST_st2_fsm_1;
            } else {
                ap_NS_fsm = ap_ST_st1_fsm_0;
            }
            break;
        case 1 : 
            ap_NS_fsm = ap_ST_st3_fsm_2;
            break;
        case 2 : 
            if (!(esl_seteq<1,1,1>(ap_const_logic_0, grp_load_points_buffer_fu_349_ap_done.read()) || esl_seteq<1,1,1>(ap_const_logic_0, grp_load_centres_buffer_fu_337_ap_done.read()))) {
                ap_NS_fsm = ap_ST_st4_fsm_3;
            } else {
                ap_NS_fsm = ap_ST_st3_fsm_2;
            }
            break;
        case 3 : 
            if (!esl_seteq<1,1,1>(exitcond_fu_377_p2.read(), ap_const_lv1_0)) {
                ap_NS_fsm = ap_ST_st16_fsm_7;
            } else {
                ap_NS_fsm = ap_ST_st5_fsm_4;
            }
            break;
        case 4 : 
            ap_NS_fsm = ap_ST_pp0_stg0_fsm_5;
            break;
        case 5 : 
            if (!(esl_seteq<1,3,3>(ap_ST_pp0_stg0_fsm_5, ap_CS_fsm.read()) && esl_seteq<1,1,1>(ap_const_logic_1, ap_reg_ppiten_pp0_it8.read()) && !esl_seteq<1,1,1>(ap_const_logic_1, ap_reg_ppiten_pp0_it7.read()))) {
                ap_NS_fsm = ap_ST_pp0_stg0_fsm_5;
            } else {
                ap_NS_fsm = ap_ST_st15_fsm_6;
            }
            break;
        case 6 : 
            ap_NS_fsm = ap_ST_st4_fsm_3;
            break;
        case 7 : 
            if (!esl_seteq<1,1,1>(ap_const_logic_0, grp_store_output_buffer_fu_362_ap_done.read())) {
                ap_NS_fsm = ap_ST_st1_fsm_0;
            } else {
                ap_NS_fsm = ap_ST_st16_fsm_7;
            }
            break;
        default : 
            ap_NS_fsm =  (sc_lv<3>) ("XXX");
            break;
    }
}
